import React from "react";
import { MDBCarousel, MDBCarouselCaption, MDBCarouselInner, MDBCarouselItem, MDBView, MDBMask, MDBContainer } from
"mdbreact";


class Carousel extends React.Component {

    constructor() {
        super();
        this.one = null;
        this.two = null;
        this.three = null;
        this.four = null;
    }

    createTable() {
        this.one = this.getRandomCity();
        this.two = this.getRandomCity();
        this.three = this.getRandomCity();
        this.four = this.getRandomCity();

        var list = [];
        list.push(<li key={0}> <City src={this.one.image} name={this.one.name} /> </li>);
        list.push(<li key={1}> <City src={this.two.image} name={this.two.name} /> </li>);
        list.push(<li key={2}> <City src={this.three.image} name={this.three.name} /> </li>);
        list.push(<li key={3}> <City src={this.four.image} name={this.four.name} /> </li>);

        return list;
    }

    getRandomCity() {
        var current = data[Math.floor(Math.random() * data.length)];
        if(!current.used) {
            current.used = true;
            return current;
        } else {
            current = data[Math.floor(Math.random() * data.length)];
            current.used = true;
            return current;
        }
    }

    render() {
        return (
            <MDBContainer className="carousel">
              <h4 className="mt-5 mb-2">Popular MYtineraries</h4>
              <MDBCarousel activeItem={1} length={4} showControls={true} showIndicators={true} className="z-depth-1">
                <MDBCarouselInner>
                  <MDBCarouselItem itemId="1">
                    <MDBView>
                      <img className="d-block w-100" src="https://mdbootstrap.com/img/Photos/Slides/img%20(68).jpg" alt="First slide" />
                      <MDBMask overlay="black-light" />
                    </MDBView>
                    <MDBCarouselCaption>
                      <h3 className="h3-responsive">Light mask</h3>
                      <p>First text</p>
                    </MDBCarouselCaption>
                  </MDBCarouselItem>
                  <MDBCarouselItem itemId="2">
                    <MDBView>
                      <img className="d-block w-100" src="https://mdbootstrap.com/img/Photos/Slides/img%20(99).jpg" alt="Second slide" />
                      <MDBMask overlay="black-strong" />
                    </MDBView>
                    <MDBCarouselCaption>
                      <h3 className="h3-responsive">Strong mask</h3>
                      <p>Second text</p>
                    </MDBCarouselCaption>
                  </MDBCarouselItem>
                  <MDBCarouselItem itemId="3">
                    <MDBView>
                      <img className="d-block w-100" src="https://mdbootstrap.com/img/Photos/Slides/img%20(17).jpg" alt="Third slide" />
                      <MDBMask overlay="black-slight" />
                    </MDBView>
                    <MDBCarouselCaption>
                      <h3 className="h3-responsive">Slight mask</h3>
                      <p>Third text</p>
                    </MDBCarouselCaption>
                  </MDBCarouselItem>
                  <MDBCarouselItem itemId="4">
                    <MDBView>
                      <img className="d-block w-100" src="https://mdbootstrap.com/img/Photos/Slides/img%20%28143%29.jpg" alt="Mattonit's item" />
                      <MDBMask overlay="black-light" />
                    </MDBView>
                    <MDBCarouselCaption>
                      <h3 className="h3-responsive">Sopot Beach</h3>
                      <p>Taken june 21th by @mattonit</p>
                    </MDBCarouselCaption>
                  </MDBCarouselItem>
                </MDBCarouselInner>
              </MDBCarousel>
            </MDBContainer>
          );
    }   
}

export default Carousel;
